import React from 'react';
import PropTypes from 'prop-types';
import { Table, TableBody, TableCell, TableContainer, TableRow, Paper, Typography } from '@mui/material';

export default function RenderMetrics({ metrics }) {
  return (
    <TableContainer component={Paper} sx={{ mb: 4 }}>
      <Typography variant="h6" sx={{ p: 2 }}>Model Metrics</Typography>
      <Table>
        <TableBody>
          {Object.entries(metrics).map(([key, value]) => (
            <TableRow key={key}>
              <TableCell>{key.replace(/_/g, ' ').toUpperCase()}</TableCell>
              <TableCell>{Array.isArray(value) ? value.join(', ') : value}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

RenderMetrics.propTypes = {
  metrics: PropTypes.object.isRequired,
};
